let initialState = {};

export default (state = initialState, action) => {
    if(state === undefined) {
        console.error('State is undefined');
        return initialState;
    }

    let { type, payload = {} } = action;

    switch (type) {
      case "GET":
        return { ...state };

      case "POST":
        return { ...state };

      default:
        return state;
    }
};
